import {ProductConsumer} from '../context';
import {Link} from 'react-router-dom';
class Detail extends React.Component {
  render() {
    return(
      <ProductConsumer>
        {(value)=>{ const {id,img,company} = value.detailProduct }}
      </ProductConsumer>
    );
  }
}
export default Detail;
